import React from 'react';
import { Contextt } from '../App';
import {Link,Route } from 'react-router-dom';
import Post from '../components_new/post/post';

export default () => {
    return (
        <div> 
            <h1>Posts</h1>
            <Contextt.Consumer>
                {
                    (obj) => {
                        return (
                            obj.posts.map((v) => 
                                <Post 
                                    key={v.postId}
                                    id={v.postId}
                                    author={v.author}
                                    date={v.date}
                                    title={v.title}
                                    disc={v.shordDesc}
                                    comments={v.comments}/>
                            )
                        );

                    }
                }
            </Contextt.Consumer>
            <Route path='/posts/:id'/>
        </div>
    );
}
